svg.script:

var timeline = new TimelineMax({onComplete:onComplete});

timeline.addLabel("time_track1", 0.25);
timeline.addLabel("time_track2", 1.75);
timeline.addLabel("time_track3", 2.75);
timeline.addLabel("time_track4", 6.25);
timeline.addLabel("time_track5", 10.25);
timeline.addLabel("time_track6", 13.25);

timeline.set("svg", {opacity:1});

var tweens = TweenMax.staggerTo(".rayLine",1000,{ease:Linear.easeNone,repeat:-1,"stroke-dashoffset":20000}, .35);

for(var i=0;i<tweens.length;i++){
    var tween = tweens[i];
    tween.progress(Math.random()+0.5);
    tween.timeScale(Math.random()+0.5);
}


timeline.from("#rotation", 80, {rotation:360, transformOrigin:"center", ease:Linear.easeNone, repeat:-1}, "time_track1");

timeline.from(".mainLine", .45, {ease:Linear.easeNone,"stroke-dashoffset":106}, "time_track1");
timeline.from(".topLine", .65, {ease:Linear.easeNone,"stroke-dashoffset":100}, "time_track1+=.25");
timeline.from(".bottomLine", .65, {ease:Linear.easeNone,"stroke-dashoffset":100}, "time_track1+=.25");
timeline.from(".mainLineEnd", .15, {ease:Power2.easeOut, scale:.0001, transformOrigin:"center", repeat:-1, yoyo:true, repeatDelay:.25}, "time_track1+=.4");
timeline.from(".topLineEnd", .15, {ease:Power2.easeOut, scale:.0001, transformOrigin:"center", repeat:-1, yoyo:true, repeatDelay:.5}, "time_track1+=.35");
timeline.from(".bottomLineEnd", .15, {ease:Power2.easeOut, scale:.0001, transformOrigin:"center", repeat:-1, yoyo:true, repeatDelay:.75}, "time_track1+=.3");
timeline.from(".largeBurst", .15, {ease:Power2.easeOut, scale:.0001, transformOrigin:"center", repeat:-1, yoyo:true, repeatDelay:.5}, "time_track1+=.3");
timeline.from(".smallBurst", .15, {ease:Power2.easeOut, scale:.0001, transformOrigin:"center", repeat:-1, yoyo:true, repeatDelay:.25}, "time_track1+=.3");

timeline.staggerFromTo(".dashedOutsideLines", 200, {ease:Linear.easeNone,repeat:-1,"stroke-dashoffset":0}, {ease:Linear.easeNone,repeat:-1,"stroke-dashoffset":6000},.2, "time_track1");

timeline.from("#innerHouseRotationPoint, .ventCircle", 80, {rotation:-360, transformOrigin:"center", ease:Linear.easeNone, repeat:-1}, "time_track1");

timeline.fromTo(".innerRing", 20, {ease:Linear.easeNone,repeat:-1,"stroke-dashoffset":0}, {ease:Linear.easeNone,repeat:-1,"stroke-dashoffset":300}, "time_track1");
timeline.fromTo(".dashedBreathLine", 200, {ease:Linear.easeNone,repeat:-1,"stroke-dashoffset":0}, {ease:Linear.easeNone,repeat:-1,"stroke-dashoffset":3000}, "time_track1");
timeline.staggerFrom(".breathLines1 path", .5, {scale:.0001, ease:Power2.easeInOut, transformOrigin:"center", yoyo:true, repeat:-1, repeatDelay:.5},.1, "time_track1");
timeline.staggerFrom(".breathLines2 path", .5, {scale:.0001, ease:Power2.easeInOut, transformOrigin:"center", yoyo:true, repeat:-1, repeatDelay:.5},.1, "time_track1");
timeline.from("#innerHouseRing", 2, {rotation:20, transformOrigin:"center", ease:Power2.easeInOut, repeat:-1, yoyo:true}, "time_track1");

timeline.staggerFrom(".floatingCenter", .25, {scale:.0001, transformOrigin:"center", ease:Linear.easeNone, yoyo:true, repeat:-1, repeatDelay:.35}, .5, "time_track1");
timeline.fromTo(".floatingCenterDash", 50, {ease:Linear.easeNone,repeat:-1,"stroke-dashoffset":0}, {ease:Linear.easeNone,repeat:-1,"stroke-dashoffset":1000}, "time_track1");


var isComplete=true;
function onComplete(){
    isComplete=true;
}
